package bean;

public class thongsobean {
	private String maxe;
	private String tenxe;
	private String dungtich;
	private String hopso;
	private String loaidongco;
	private String congnghe;
	private String chieucao;
	private String trongluong;
	private String baohanh;
	public thongsobean() {
		super();
		// TODO Auto-generated constructor stub
	}
	public thongsobean(String maxe, String tenxe, String dungtich, String hopso, String loaidongco, String congnghe,
			String chieucao, String trongluong, String baohanh) {
		super();
		this.maxe = maxe;
		this.tenxe = tenxe;
		this.dungtich = dungtich;
		this.hopso = hopso;
		this.loaidongco = loaidongco;
		this.congnghe = congnghe;
		this.chieucao = chieucao;
		this.trongluong = trongluong;
		this.baohanh = baohanh;
	}
	public String getMaxe() {
		return maxe;
	}
	public void setMaxe(String maxe) {
		this.maxe = maxe;
	}
	public String getTenxe() {
		return tenxe;
	}
	public void setTenxe(String tenxe) {
		this.tenxe = tenxe;
	}
	public String getDungtich() {
		return dungtich;
	}
	public void setDungtich(String dungtich) {
		this.dungtich = dungtich;
	}
	public String getHopso() {
		return hopso;
	}
	public void setHopso(String hopso) {
		this.hopso = hopso;
	}
	public String getLoaidongco() {
		return loaidongco;
	}
	public void setLoaidongco(String loaidongco) {
		this.loaidongco = loaidongco;
	}
	public String getCongnghe() {
		return congnghe;
	}
	public void setCongnghe(String congnghe) {
		this.congnghe = congnghe;
	}
	public String getChieucao() {
		return chieucao;
	}
	public void setChieucao(String chieucao) {
		this.chieucao = chieucao;
	}
	public String getTrongluong() {
		return trongluong;
	}
	public void setTrongluong(String trongluong) {
		this.trongluong = trongluong;
	}
	public String getBaohanh() {
		return baohanh;
	}
	public void setBaohanh(String baohanh) {
		this.baohanh = baohanh;
	}
	
}
